pragma solidity >=0.4.23 <0.6.0;

import 'openzeppelin-solidity/contracts/ownership/Ownable.sol';
import 'openzeppelin-solidity/contracts/access/Roles.sol';
import 'contracts/Bid.sol';

contract Tender is Ownable {
  using Roles for Roles.Role;

  Roles.Role private vendors;

  bool public biddingPeriod;
  address public winnigVendor;
  uint public number;
  uint public enablingScore;
  uint public basePrice;
  uint[] public scheduleDates;
  bytes32[] public ipfsHashes;
  bytes32[] public questionnaires;
  string public office;
  string public name;
  string public description;
  string[] public messages;
  Observation[] public observations;
  Observation[] public winnerObservations;
  Bid[] public bids;
  PublicKey public publicKey;

  event TenderCreated(address indexed _owner, string _name);

  struct Observation {
    string plain;
    string hash;
    uint numResponses;
    mapping (uint => Response) responses;
  }

  struct Response {
    string plain;
    string hash;
  }

  struct PublicKey {
    bytes17 r;
    bytes17 s;
  }

  constructor(
    uint _number                    ,
    string memory _office           ,
    string memory _name             ,
    string memory _description      ,
    uint _enablingScore             ,
    bytes17[] memory _publicKey     ,
    bytes32[] memory _ipfsHashes    ,
    bytes32[] memory _questionnaires,
    uint _basePrice                 ,
    uint[] memory _scheduleDates
  ) public {
    description = _description;
    biddingPeriod = false;
    number = _number;
    office =  _office;
    name = _name;
    enablingScore = _enablingScore;
    publicKey = PublicKey({ r: _publicKey[0], s: _publicKey[1] });
    ipfsHashes = _ipfsHashes;
    questionnaires = _questionnaires;
    basePrice = _basePrice;
    scheduleDates = _scheduleDates;
    emit TenderCreated(msg.sender, name);
  }

  function submitObservation(string memory _plain) public {
    observations.push(Observation({plain: _plain, hash: "", numResponses: 0}));
  }

  function submitObservation(string memory _plain, string memory _hash) public {
    observations.push(Observation({plain: _plain, hash: _hash, numResponses: 0}));
  }

  function respondObservation(uint _idx, string memory _plain, string memory _hash) public onlyOwner {
    Observation storage obs = observations[_idx];
    obs.responses[obs.numResponses++] = Response({plain: _plain, hash: _hash});
  }

  function submitWinnerObservation(string memory _plain) public {
    winnerObservations.push(Observation({plain: _plain, hash: "", numResponses: 0}));
  }

  function submitWinnerObservation(string memory _plain, string memory _hash) public {
    winnerObservations.push(Observation({plain: _plain, hash: _hash, numResponses: 0}));
  }

  function respondWinnerObservation(uint _idx, string memory _plain, string memory _hash) public onlyOwner {
    Observation storage obs = winnerObservations[_idx];
    obs.responses[obs.numResponses++] = Response({plain: _plain, hash: _hash});
  }

  function getObservationsLength() public view returns(uint) {
    return observations.length;
  }

  function submitMessage(string memory _message) public {
    messages.push(_message);
  }

  function getMessagesLength() public view returns(uint) {
    return messages.length;
  }


  function getWinnerObservationsLength() public view returns(uint) {
    return winnerObservations.length;
  }

  function getQuestionnaireLength() public view returns (uint) {
    return questionnaires.length;
  }

  function createBid() public {
    require(biddingPeriod,"The bidding period has not started yet.");
    require(!vendors.has(msg.sender), "Vendor already upload bid.");
    Bid bid = new Bid(owner());
    bid.transferOwnership(msg.sender);
    bids.push(bid);
    vendors.add(msg.sender);
  }

  function getBidsLength() public view returns(uint) {
    return bids.length;
  }

  function startAuction() public onlyOwner {
    biddingPeriod = true;
  }
  function setWinnigVendor() public onlyOwner {
    require(bids.length > 0, "The are no possible winners, since there are not any bids");
    winnigVendor = bids[0].owner();
  }

  function getResponseAt(uint _obsIdx, uint _resIdx) public view returns (string memory _plain, string memory _hash) {
    _plain = observations[_obsIdx].responses[_resIdx].plain;
    _hash = observations[_obsIdx].responses[_resIdx].hash;
  }

  function getWinnerObservationResponseAt(uint _obsIdx, uint _resIdx) public view returns (string memory _plain, string memory _hash) {
    _plain = winnerObservations[_obsIdx].responses[_resIdx].plain;
    _hash = winnerObservations[_obsIdx].responses[_resIdx].hash;
  }
}
